import Header from './Component/Header'
import Home from './Component/Home';
import Footer from './Component/Footer';
import './index.css';
// import Card from './Component/Card';

class App extends Component {
  render(){
     return (
      <div>
        <Header />
        <Home />
        <Footer />
      </div>
    );
  }

}

export default App;
